    J[1994] += dqdci;             /* dwdot[C5H10-1]/d[CH3CO] */
    J[2040] -= dqdci;             /* dwdot[C7H14O2-4]/d[CH3CO] */
    /* d()/d[C5H10-1] */
    dqdci =  - k_r*sc[12]*sc[22];
    J[3215] -= dqdci;             /* dwdot[HO2]/d[C5H10-1] */
    J[3216] += dqdci;             /* dwdot[H2O2]/d[C5H10-1] */
    J[3226] += dqdci;             /* dwdot[CH3CO]/d[C5H10-1] */
    J[3240] += dqdci;             /* dwdot[C5H10-1]/d[C5H10-1] */
    J[3286] -= dqdci;             /* dwdot[C7H14O2-4]/d[C5H10-1] */
    /* d()/d[C7H14O2-4] */
    dqdci =  + k_f*sc[11];
    J[7309] -= dqdci;             /* dwdot[HO2]/d[C7H14O2-4] */
    J[7310] += dqdci;             /* dwdot[H2O2]/d[C7H14O2-4] */
    J[7320] += dqdci;             /* dwdot[CH3CO]/d[C7H14O2-4] */
    J[7334] += dqdci;             /* dwdot[C5H10-1]/d[C7H14O2-4] */
    J[7380] -= dqdci;             /* dwdot[C7H14O2-4]/d[C7H14O2-4] */
    /* d()/dT */
    J[7843] -= dqdT;              /* dwdot[HO2]/dT */
    J[7844] += dqdT;              /* dwdot[H2O2]/dT */
    J[7854] += dqdT;              /* dwdot[CH3CO]/dT */
    J[7868] += dqdT;              /* dwdot[C5H10-1]/dT */
    J[7914] -= dqdT;              /* dwdot[C7H14O2-4]/dT */

    /*reaction 386: C7H14O1-3 + HO2 <=> C2H4 + NC4H9CO + H2O2 */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[11]*sc[81];
    k_f = 1.0000000000000002e-06 * 5000000000000
                * exp(0 * tc[0] - 0.50321666580471969 * (17700) * invT);
    dlnkfdT = 0 * invT + 0.50321666580471969 *  17700  * invT2;
    /* reverse */
    phi_r = sc[12]*sc[16]*sc[57];
    Kc = refC * exp(g_RT[11] - g_RT[12] - g_RT[16] - g_RT[57] + g_RT[81]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[11] + h_RT[81]) + (h_RT[12] + h_RT[16] + h_RT[57]) - 1.000000);
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
