    dqdT = (dlnkfdT*k_f*phi_f - dkrdT*phi_r);
    /* update wdot */
    wdot[11] -= q; /* HO2 */
    wdot[12] += q; /* H2O2 */
    wdot[16] += q; /* C2H4 */
    wdot[57] += q; /* NC4H9CO */
    wdot[81] -= q; /* C7H14O1-3 */
    /* d()/d[HO2] */
    dqdci =  + k_f*sc[81];
    J[990] -= dqdci;              /* dwdot[HO2]/d[HO2] */
    J[991] += dqdci;              /* dwdot[H2O2]/d[HO2] */
    J[995] += dqdci;              /* dwdot[C2H4]/d[HO2] */
    J[1036] += dqdci;             /* dwdot[NC4H9CO]/d[HO2] */
    J[1060] -= dqdci;             /* dwdot[C7H14O1-3]/d[HO2] */
    /* d()/d[H2O2] */
    dqdci =  - k_r*sc[16]*sc[57];
    J[1079] -= dqdci;             /* dwdot[HO2]/d[H2O2] */
    J[1080] += dqdci;             /* dwdot[H2O2]/d[H2O2] */
    J[1084] += dqdci;             /* dwdot[C2H4]/d[H2O2] */
    J[1125] += dqdci;             /* dwdot[NC4H9CO]/d[H2O2] */
    J[1149] -= dqdci;             /* dwdot[C7H14O1-3]/d[H2O2] */
    /* d()/d[C2H4] */
    dqdci =  - k_r*sc[12]*sc[57];
    J[1435] -= dqdci;             /* dwdot[HO2]/d[C2H4] */
    J[1436] += dqdci;             /* dwdot[H2O2]/d[C2H4] */
    J[1440] += dqdci;             /* dwdot[C2H4]/d[C2H4] */
    J[1481] += dqdci;             /* dwdot[NC4H9CO]/d[C2H4] */
    J[1505] -= dqdci;             /* dwdot[C7H14O1-3]/d[C2H4] */
    /* d()/d[NC4H9CO] */
    dqdci =  - k_r*sc[12]*sc[16];
    J[5084] -= dqdci;             /* dwdot[HO2]/d[NC4H9CO] */
    J[5085] += dqdci;             /* dwdot[H2O2]/d[NC4H9CO] */
    J[5089] += dqdci;             /* dwdot[C2H4]/d[NC4H9CO] */
    J[5130] += dqdci;             /* dwdot[NC4H9CO]/d[NC4H9CO] */
    J[5154] -= dqdci;             /* dwdot[C7H14O1-3]/d[NC4H9CO] */
    /* d()/d[C7H14O1-3] */
    dqdci =  + k_f*sc[11];
    J[7220] -= dqdci;             /* dwdot[HO2]/d[C7H14O1-3] */
    J[7221] += dqdci;             /* dwdot[H2O2]/d[C7H14O1-3] */
    J[7225] += dqdci;             /* dwdot[C2H4]/d[C7H14O1-3] */
    J[7266] += dqdci;             /* dwdot[NC4H9CO]/d[C7H14O1-3] */
    J[7290] -= dqdci;             /* dwdot[C7H14O1-3]/d[C7H14O1-3] */
    /* d()/dT */
    J[7843] -= dqdT;              /* dwdot[HO2]/dT */
    J[7844] += dqdT;              /* dwdot[H2O2]/dT */
    J[7848] += dqdT;              /* dwdot[C2H4]/dT */
    J[7889] += dqdT;              /* dwdot[NC4H9CO]/dT */
    J[7913] -= dqdT;              /* dwdot[C7H14O1-3]/dT */

    /*reaction 387: C7H14O2-4 + HO2 <=> C3H6 + NC3H7CO + H2O2 */
    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[11]*sc[82];
    k_f = 1.0000000000000002e-06 * 5000000000000
                * exp(0 * tc[0] - 0.50321666580471969 * (17700) * invT);
    dlnkfdT = 0 * invT + 0.50321666580471969 *  17700  * invT2;
    /* reverse */
    phi_r = sc[12]*sc[26]*sc[53];
    Kc = refC * exp(g_RT[11] - g_RT[12] - g_RT[26] - g_RT[53] + g_RT[82]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[11] + h_RT[82]) + (h_RT[12] + h_RT[26] + h_RT[53]) - 1.000000);
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
