    dqdci =  - k_r*sc[12]*sc[53];
    J[2325] -= dqdci;             /* dwdot[HO2]/d[C3H6] */
    J[2326] += dqdci;             /* dwdot[H2O2]/d[C3H6] */
    J[2340] += dqdci;             /* dwdot[C3H6]/d[C3H6] */
